import styled from 'styled-components';
import './Home.css';

import React from 'react';
import logo from "./spoti.png";
import image from "./image.png";



const StyledImg = styled.img`
  width: 150px;


`;

const StyledImage = styled.image`
  width: 150px;


`;


function Home() {
  return (
    <div className='home'>
      <StyledImg src={logo} alt="Logo"></StyledImg>
      <div className='home2'>
      <a href="1">Artists</a>
      <a href="2">Albums</a>
      <a href="3">Genres</a>
      <a href="4">Tracks</a>
      <a href="5">Albums genres</a>
      </div>
      <div className='img'>
      <StyledImage src={image} alt="image"></StyledImage>
      </div>
      </div>


  )

}

export default Home;
